import React from "react";
//import { Link } from "react-router-dom";
import "./ConsultaTramite.scss";

export default function ConsultaTramite() {
  return (
    <div className="col-12 col-sm-6 col-lg-4">
      <div className="tarjeta-acciones mb-4">
        <div className="head-acciones">
          <h5 className="titulo-">Consulta el Estado de tu Trámite</h5>
        </div>
        <div className="body-acciones">
          <p>
            Consulte el estado de sus solicitudes ante la Comisión de Regulación
            de Comunicaciones.
          </p>
        </div>
      </div>
    </div>
  );
}
